script:
reset();

const size = { x: 32, y: 64, z: 16 };
const origin = { x: size.x * -0.5, z: size.z * -0.5 };
const walls = 12;
const noise = new SimplexNoise('SuperSeed');

box(origin.x - 1, 0, origin.z - 1, size.x + 2, walls, size.z + 1, 5);
box(origin.x, 0, origin.z, size.x, walls, size.z, 1);
box(origin.x + 1, 1, origin.z + 1, size.x - 2, walls, size.z - 2, 0);
box(origin.x + 1, 0, origin.z, size.x - 2, size.y, 1, 3);
box(origin.x + 1, walls, origin.z - 1, size.x - 2, size.y - walls, 1, 5);

box(origin.x, size.y - 1, origin.z - 9, size.x, 10, 9, 1);
box(origin.x, size.y + 8, origin.z, size.x, 1, 4, 1);
box(origin.x + 1, size.y, origin.z - 8, size.x - 2, 8, 9, 0);
box(origin.x + 4, size.y + 3, origin.z - 9, size.x - 8, 2, 1, 0);
for (let x = 2; x < size.x - 2; x += 1) {
  for (let y = 1; y < size.y - 1; y += 1) {
    const h = (
      Math.abs(noise.noise2D(y / 20, x / 20))
      + Math.abs(noise.noise2D(x / 10, y / 10))
      + Math.abs(noise.noise2D(x / 2, y / 2))
    ) * 4 - 6;
    if (h > 0) {
      box(origin.x + x, y, origin.z + 1, 1, 1, h, 2);
    }
  }
}

const elevator = {
  x: origin.x + 13,
  y: 0,
  z: origin.z + size.z,
};

box(
  elevator.x - 1, elevator.y, elevator.z,
  8, 8, 7,
  3
);
box(
  elevator.x, elevator.y, elevator.z,
  6, 7, 6,
  4
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  4, 5, 4,
  0
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z - 2,
  4, 5, 1,
  3
);
box(
  elevator.x + 2, elevator.y + 1, elevator.z - 2,
  2, 4, 3,
  0
);
